    audio.play();

        return (
            <div onLoad={playAudio}>
                <img className="main_logo" height="600" src={`${process.env.PUBLIC_URL}/logo.gif`} />
                <div>
                    <a href="/mode">
                        <img className="press_start" height="100" src={`${process.env.PUBLIC_URL}/press_start.gif`} />
                    </a>
                </div>
            </div>

        )
    }

    export default Home;
